import React from 'react';
import { Link }  from 'react-router-dom';
import 'animate.css';

let vid = document.getElementById("myVideo");
function playVid() {
  vid.play();
	vid.autoplay = true;
	document.getElementById("myVideo").load();

}

function myFunction() {
  document.getElementById("myVideo").load();
}


export default () => (
	<div className='landing'>
		<div className='info'>
		<video id="myVideo" controls preload="auto" loop id="video-background" plays-inline controls allow="autoplay" id="audio" onloadedmetadata="this.autoplay = true" playsinline autoplay muted loop controls>
		<source onclick="playVid()" src="https://www.learningcontainer.com/bfd_download/sample-mp4-file/" allow="autoplay" id="audio" onloadedmetadata="this.autoplay = true" >
						</source>

		</video>



		<h2>
		New Wave
		</h2>
		<h3>Property Group</h3>
			<p class="animated fadeInUp">We take your dream home and make it real.</p>
			<Link to='/contactpage'>
			<button className="button1">BOOK YOUR CONSULTATION</button>
			</Link>

		</div>
	</div>
);
